var zoneCodes = generateZoneCodes()

func zoneForCode(code l10n.Code) *tax.Zone {
	for _, v := range zones {
		if v.Code == code {
			return &v
		}
	}
	return nil
}

func generateZoneCodes() []interface{} {
	ary := make([]interface{}, len(zones))
	for i, v := range zones {
		ary[i] = v.Code
	}
	return ary
}
